import React from "react";
import { Link } from "react-router-dom";
import Button from "@material-ui/core/Button";

function Today() {
  return (
    <div>
      <h1>Welcome to Today List</h1>
      <Button component={Link} to={"/"}>
        Go back to Home
      </Button>
    </div>
  );
}

export default Today;
